('zAKoRGhS', 'HCfIaoOx', 'New PWA project', 'Project name: FocusBook\nDescription :\n\nA focus book is book where you put all your preoccupations, projects, your little problem in the goal of be aware of things that clutter my mind.\nThen the user will be able to delete or save useless or useful things from this focus book reducing therefore the mental charge of the user.\nAfter the mental charge reduced, the user will be more free and get clear mind.\nIn the focus book we could be able to save our most important goals of the year ( for instance)  and see our progression \n\n\nTechnologies :\n- Boostrapp\n- PHP', 'Courier New', '#ffe4c4bc', 'myself', NULL, '2024-02-23 11:06:33'),
