('ZVTrgxJU', 'MRqJ67KE', 'Outils ai+', '- Calendly : Un outil pour prendre et ou g&eacute;rer des rendez-vous\n- Framer ai : permet de créer des sites web simples à l\'aide de prompts. Permet aussi de créer des sites web avancé et hyper personnalisé\n- Opus Clip : Permet à base de vidéos créer des shorts avec sous titres pour TikTok, YouTube...\n- Adobe FireFly : Logiciel Adobe pour traiter, modifier des images à l\'aide des prompts\n- KOME : est une extension de Google Chrome permettant de résumer des articles de pages web\n- Erase background: Un outil qui permet de supprimer le background des photos\n- ai quizz maker : une AI qui génère des quizz à partir des textes (aidant par exemple à étudier)\n- Click up, assana, Monday: pour gérer des projets\n- Linear : Outil pour gérer les projets de sites web', 'Courier New', '#89f3ff7a', 'share', 'Ebqgqd0xG9i2P4BB', '2024-06-18 10:48:40');
